function Nav() {
  return (
    <Navbar>
      <LinkContainer to="/searchbooks"><Button variant="outline-secondary">asdf</Button></LinkContainer>
      <LinkContainer to="/searchbooks"><Button>asdfasdf</Button></LinkContainer>
    </Navbar>
  );
}

export default Nav;
